import logo from './logo.svg';
import './App.css';
import { useState } from 'react';

function Counter() {
    const [count, setcount] = useState(5)

    const andre = function(){
      setcount(count+1)
    }

    return (
      <>

      <div>
        <button onClick={andre}>+</button>
        <span>{count}</span>
      </div>
      </>
    );
}



export default Counter;
